    <GoogleOAuthProvider clientId={process.env.REACT_APP_GOOGLE_CLIENT_ID || ""}>
      <AuthProvider> {/* ✅ Wrap App with AuthProvider */}
        <App />
      </AuthProvider>
    </GoogleOAuthProvider>
  </React.StrictMode>
);

